import React from "react";
import { Box, Container, Text } from "@chakra-ui/react";
const HomePage = () => {
  return (
    <Container maxW='xl' centerContent>
      <Box
        d="flex"
        justifyContent='center'
        padding={3}
        background={"white"}
        w='100%'
        m='40px 0 15px 0'
        borderRadius='lg'
        borderWidth='1px'
      >
        <Text
          fontSize={'4xl'}
          fontFamily='Work sans'
          color={'black'}

        >
          Meow Meow
        </Text>
      </Box>
      <Box
        bg='white' w='100%'
      >

      </Box>


    </Container>
  )
};

export default HomePage;;
